import React from "react";
import {BrowserRouter} from "react-router-dom";
import {Button, Input, Select, Table} from "antd";
import {Option} from "antd/es/mentions";

class Article extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <div style={{width: "40%"}}>
                    <Input.Group compact style={{display: "flex"}}>
                        <Select defaultValue={"文章标题"}>
                            <Select.Option value={"title"}>文章标题</Select.Option>
                            <Select.Option value={"cate"}>文章类别</Select.Option>
                        </Select>
                        <Input style={{width: "200px"}}/>&nbsp;&nbsp;&nbsp;
                        <Button type={"primary"}>搜索</Button>&nbsp;&nbsp;&nbsp;
                        <Button type={"primary"}>添加</Button>
                    </Input.Group>
                </div>
                <Table bordered>
                    <thead>
                    <tr>
                        <th width={"30px"}>编号</th>
                        <th width={"100px"}>标题</th>
                        <th width={"50px"}>类别</th>
                        <th width={"100px"}>摘要</th>
                        <th width={"100px"}>封面</th>
                        <th width={"100px"}>创建时间</th>
                        <th width={"100px"}>更新时间</th>
                        <th colSpan={2} width={"100px"}>操作</th>
                    </tr>
                    </thead>
                    <tbody>
                    {
                        <tr key={"id"}>

                        </tr>
                    }
                    </tbody>
                </Table>
            </BrowserRouter>
        )
    }
}

export default Article;
